import { LightningElement,api,track } from 'lwc';

export default class CheckListQuestionChild extends LightningElement {
    @api constrollinOperator;
    @api controllingAnswer;
    @api 
    set controllingValue(val){
        if(val == undefined){
            val = false;
        }
        val= val+'';
        this._controllingValue = val;
        this.validateShow();

    };
    get controllingValue(){
        return this._controllingValue;
    }
    isWarningfalse = false;
    isWarningTrue = false;
    loaded = false;
    alertMessageFalse;
    alertMessageTrue;
    _controllingValue;
    currentValue;
    @api question;
    showContainer = 'display:block;';
    @api fromEditBtn;

    renderedCallback(){
        if(this.loaded){
            return;
        }
        this.loaded = true;
        this.validateShow();
        this.checkForAlert();
        
    }
    
    @api
    checkForAlert(){
        if(this.question.AlertMsgWhenFalse__c != null || this.question.AlertMsgWhenFalse__c != undefined){
            this.alertMessageFalse = this.question.AlertMsgWhenFalse__c;
            this.isWarningfalse = true;
        }
        let children = this.template.querySelectorAll('.child');
        if(children && children.length > 0){
            for (let index = 0; index < children.length; index++) {
                children[index].checkForAlert();
            }
        }
    }
    @api
    validateShow(){
        if(this._controllingValue == this.question.Controlling_Answer__c){
            this.showContainer = 'display:block;';
        }else{
            this.showContainer = 'display:none;';
        }
        if( this.question.value  && this._controllingValue == undefined && this.question.Controlling_Answer__c == undefined){ 
            this.currentValue = this.question.value; 
            this.showContainer = 'display:block;';
        }
        let children = this.template.querySelectorAll('.child');
        if(children && children.length > 0){
            for (let index = 0; index < children.length; index++) {
                children[index].validateShow();
            }
        }
    }

    checkChildrens(){
        if(this.question.AlertMsgWhenFalse__c != null || this.question.AlertMsgWhenFalse__c != undefined){
            this.alertMessageFalse = this.question.AlertMsgWhenFalse__c;
            this.isWarningfalse = true;
        }
        let children = this.template.querySelectorAll('.child');
        if(children && children.length > 0){
            for (let index = 0; index < children.length; index++) {
                children[index].checkForAlert();
            
            }
        }
    }

    handleChange(event){

        if(this.question.Question_Type__c == 'toggle'){
            
            this.currentValue = event.target.checked;

             if(this.currentValue == false && (this.question.AlertMsgWhenFalse__c != null || this.question.AlertMsgWhenFalse__c != undefined)){
                this.isWarningTrue = false;
                this.alertMessageFalse = this.question.AlertMsgWhenFalse__c;
                this.isWarningfalse = true;

            }else{
                this.isWarningfalse = false;


                //let currentAnswer = {question:this.question.Question__c, questionId:this.question.Id, answer:false, type:this.question.Question_Type__c, children:[]};
                let children = this.template.querySelectorAll('.child');
                console.log('children ' + children);

                if (children && children.length > 0) {
                    for (let index = 0; index < children.length; index++) {
                        console.log('children[index]  ' + JSON.stringify(children[index].obtainData()));
                        children[index].answer = false;
                        children[index].value = false;
                        console.log('children[index] DESPUES DE EDITAR ' + JSON.stringify(children[index].obtainData()));
                    }
                }

                /*this.dispatchEvent(new CustomEvent('togglechange', {
                    detail: { parentId: this.question.Id, checked: this.currentValue },
                    bubbles: true, // Permitir la propagación del evento a través de las instancias recursivas
                    composed: true, // Permitir que el evento cruce los límites del Shadow DOM
                }));*/
            }

            if(this.currentValue == true && (this.question.AlertMsgWhenTrue__c != null || this.question.AlertMsgWhenTrue__c != undefined)){
                this.isWarningfalse = false
                this.alertMessageTrue = this.question.AlertMsgWhenTrue__c;
                this.isWarningTrue = true;
                
            }else{
                this.isWarningTrue = false;
            }

        }else{
            this.currentValue = event.detail.value;
        }

    }

    @api
    obtainData() {
        let result = [];
        let currentAnswer;
        var fullFalse;
        if(this.question.Question_Type__c == 'toggle'){
            if(this.currentValue != true){
                //this.currentValue = false;
                //fullFalse = false;
            }
        }else if(this.currentValue == null || this.currentValue == undefined)
        {
            this.currentValue = 'N/A';
        }
        console.log('##Obtain Data this.question.value : ' + this.question.value );
        console.log('##Obtain Data this.currentValue : ' + this.currentValue );
        if (this.currentValue != undefined){
            currentAnswer = {question:this.question.Question__c, questionId:this.question.Id, answer:this.currentValue, type:this.question.Question_Type__c, children:[]};
        }else if (this.question.value) {
            currentAnswer = {question:this.question.Question__c, questionId:this.question.Id, answer:this.question.value, type:this.question.Question_Type__c, children:[]};
        }else {
            currentAnswer = {question:this.question.Question__c, questionId:this.question.Id, answer:false, type:this.question.Question_Type__c, children:[]};
        }

        let children = this.template.querySelectorAll('.child');
        if(children && children.length > 0){
            for (let index = 0; index < children.length; index++) {
                Array.prototype.push.apply(currentAnswer.children,children[index].obtainData());
            }
        }
        result.push(currentAnswer);
        return result;
    }

}

import { LightningElement,api } from 'lwc';
import obtainQuestions from '@salesforce/apex/ChecklstController.obtainQuestions';
import saveQuestions from '@salesforce/apex/ChecklstController.saveQuestions';
import checkAnswers from '@salesforce/apex/ChecklstController.checkAnswers';
import { ShowToastEvent } from 'lightning/platformShowToastEvent';

import QuestionsTitle from '@salesforce/label/c.ChecklistMasterQuestionsTitle';
import AnswersTitle from '@salesforce/label/c.ChecklistMasterAnswersTitle';
import Error from '@salesforce/label/c.ChecklistMasterError';
import Success from '@salesforce/label/c.ChecklistMasterAnswersSuccess';
import yes from '@salesforce/label/c.ChecklistMasterYes';
import no from '@salesforce/label/c.ChecklistMasterNo';
import save from '@salesforce/label/c.ChecklistMasterSave';
import NoQuestions from '@salesforce/label/c.ChecklistMasterNoQuestions';
import obtainAnswersToEdit from '@salesforce/apex/ChecklstController.obtainAnswersToEdit';
import editQuestions from '@salesforce/apex/ChecklstController.editQuestions';
//import hasPermissionToEditAnswers from '@salesforce/customPermission/';



export default class ChecklistMaster extends LightningElement {

    labels = {
        QuestionsTitle,
        AnswersTitle,
        Error,
        Success,
        yes,
        no,
        save,
        NoQuestions
    };

    @api recordId;
    questions = [];
    questionsToEdit = [];
    loaded = false;
    showQuestions = false;
    showQuestionsToEdit = false;
    showSummary = false;
    answers;
    //fields from flow
    @api returnIdAnswer;
    @api recIdFromFlow;
    @api objName;
    @api countryCode;
    //------
    isLoad = true;
    btnFromProcess = false;
    @api countryField;
    renderedCallback(){
        if(this.loaded){
            return;
        }
        this.loaded = true;
        checkAnswers({oppoId:this.recordId != undefined ? this.recordId : this.recIdFromFlow})
            .then(result => {
                if(result != null){

                    this.answers = JSON.parse(result);
                    
                    for (let index = 0; index < this.answers.length; index++) {
                        const element = this.answers[index];

                        if(element.type == "toggle"){

                            if(element.answer == true){this.answers[index].answer = this.labels.yes;}
                            else if(element.answer == false){ this.answers[index].answer = this.labels.no;}                            
                        }

                    }
                    this.showQuestions = false;
                    this.showSummary = true;
                    this.isLoad = false;
                }else{
                    obtainQuestions({recId:this.recordId, country:this.countryField != null ? this.countryField : null, countryCode : this.countryCode != null ? this.countryCode : null,
                                    objN: this.objName != null ? this.objName : null})
                    .then(rest => {
                        if(rest.length > 0){ 
                            this.questions = rest;
                            console.log('@@@ObtainQuestion questions ' + JSON.stringify(this.questions));
                            this.showQuestions = true; 
                            this.isLoad = false;
                        }else{
                            this.showQuestions = false; 
                            this.isLoad = false;
                        }
                        
                    })
                .catch(error => {
                    console.log(error);
                    console.log(error.message);
                });
                }
            })
        .catch(error => {
        console.log(error);
        console.log(error.message);
        });
    }

    handleEdit(){

        obtainQuestions({recId:this.recordId, country:this.countryField != null ? this.countryField : null, countryCode : this.countryCode != null ? this.countryCode : null,
            objN: this.objName != null ? this.objName : null})
            .then(rest => {
                if(rest.length > 0){ 
                    const originalList = rest;
                    obtainAnswersToEdit({oppoId:this.recordId}).then(dataAnswers =>{
                        this.btnFromProcess = true;
                        const tmpDataAnswers = JSON.parse(dataAnswers);
                        this.questionsToEdit = this.updateList(originalList, tmpDataAnswers);
                        console.log('### questionsToEdit : '+JSON.stringify(this.questionsToEdit));
                        this.showSummary = false;
                        this.showQuestionsToEdit = true; 
                        this.isLoad = false;

                    }) 
                    .catch(error => {
                    console.log(error);
                    console.log(error.message);
                    });  

                }else{
                    this.showQuestionsToEdit = true; 
                    this.isLoad = false;
                }
            })
            .catch(error => {
            console.log(error);
            console.log(error.message);
            });        
    }

    // Método recursivo para actualizar la lista principal
    updateList(originalList, parsedList) {
        return originalList.map(item => {
            const matchingValue = parsedList.find(parsedItem => parsedItem.questionId === item.Id);
            if (matchingValue) {
                if (matchingValue.answer == 'true'){
                    item.value = true;
                } else if (matchingValue.answer == 'false'){
                    item.value = false;
                } else{
                    item.value = matchingValue.answer.toString();// Convierte a cadena si es necesario
                }

            }

            if (item.Dependent_Questions__r && item.Dependent_Questions__r.length > 0) {
                // Llamada recursiva para preguntas anidadas
                item.Dependent_Questions__r = this.updateList(item.Dependent_Questions__r, parsedList);
            }

            return item;
        });
    }

    handleClickEditAndSave(){
        let result = [];
        this.isLoad = true;
        const children = this.template.querySelectorAll('c-check-list-question-child');
        
        for (let index = 0; index < children.length; index++) {
            Array.prototype.push.apply(result,children[index].obtainData());
        }
        console.log('### handleClickEditAndSave : '+JSON.stringify(result));
        editQuestions({oppoId:this.recordId != undefined ? this.recordId : this.recIdFromFlow, answers:JSON.stringify(result)})
            .then(result => {

                if(result != 'error'){
                    this.showToast('success',this.labels.Success );
                    this.loaded = false;
                    this.returnIdAnswer = result;
                    this.showQuestionsToEdit = false; 
                    this.renderedCallback();
                    this.isLoad = false;
                }else{
                    this.showToast('error',this.labels.Error );
                    this.isLoad = false;
                }
            })
        .catch(error => {
        console.log(error);
        console.log(error.message);
        });
        this.isLoad = false;
    }

    handleClickCancel(){
        this.isLoad = false;
        this.loaded = false;
        this.returnIdAnswer = [];
        this.showQuestionsToEdit = false; 
        this.renderedCallback();
        this.isLoad = false;
    }

    handleClick(){
        let result = [];
        this.isLoad = true;
        const children = this.template.querySelectorAll('c-check-list-question-child');
        
        for (let index = 0; index < children.length; index++) {
            Array.prototype.push.apply(result,children[index].obtainData());
        }
        console.log(JSON.stringify(result));
        
        saveQuestions({oppoId:this.recordId != undefined ? this.recordId : this.recIdFromFlow, answers:JSON.stringify(result)})
            .then(result => {

                if(result != 'error'){
                    this.showToast('success',this.labels.Success );
                    this.loaded = false;
                    this.returnIdAnswer = result;
                    this.renderedCallback();
                    this.isLoad = false;
                }else{
                    this.showToast('error',this.labels.Error );
                    this.isLoad = false;
                }
            })
        .catch(error => {
        console.log(error);
        console.log(error.message);
        });
        this.isLoad = false;
    }

    showToast(variant,title,message){
        this.dispatchEvent(
            new ShowToastEvent({ 
                variant: variant,
                title: title,
                message: message
            })
        ); 
    }
}

/**
 * @description       : 
 * @author            : ezequiel.rios@kavak.com
 * @group             : 
 * @last modified on  : 12-12-2023
 * @last modified by  : ezequiel.rios@kavak.com
**/
public with sharing class ChecklstController {
   
    @AuraEnabled
    public static List<Checklist_Question__c> obtainQuestions (Id recId, String country, String countryCode, String objN){

        List<Checklist_Question__c> lstChkQ = new List<Checklist_Question__c>();
        SObject gralInfoObj;
        String countryIsoCod = null;
        System.debug('@@objN: ' + objN);
        String relatobjName = objN != null ? objN :String.valueof(recId.getsobjecttype());
   
        if(country != null){
            gralInfoObj = Database.query('SELECT ' + country + ' FROM ' + relatobjName  + ' WHERE Id =:recId');
            countryIsoCod = (String)gralInfoObj.get(country);
        }else if (countryCode != null){
            countryIsoCod = countryCode;
        }
        
        for (Checklist_Question__c cq :  Database.query(System.Label.QRY_ChecklistQueestions) ) {
                if(cq.Question_Type__c == 'Number'){
                    cq.Question_Type__c = cq.Question_Type__c.toLowercase();
                }
                lstChkQ.add(cq);
        }
        System.debug('@@lstChQ ' + lstChkQ);
        return lstChkQ;
    }

    @AuraEnabled
