    public class QuestionItem {
        public String questionId;
        public String answer;
        public List<QuestionItem> children;

        public QuestionItem(String id, String ans, List<QuestionItem> childList) {
            questionId = id;
            answer = ans;
            children = childList;
        }
    }

    public class QuestionWrapper {
        public String questionId;
        public String answer;

        public QuestionWrapper(String id, String ans) {
            questionId = id;
            answer = ans;
        }
    }

    public static List<QuestionWrapper> processJson(String jsonString) {
        List<QuestionItem> questionList = (List<QuestionItem>)JSON.deserialize(jsonString, List<QuestionItem>.class);
        List<QuestionWrapper> result = new List<QuestionWrapper>();

        // Recorrer la lista deserializada
        for (QuestionItem item : questionList) {
            // Obtener QuestionId y Answer
            String questionId = item.questionId;
            String answer = item.answer;

            // Imprimir valores o hacer lo que necesites con ellos
            System.debug('QuestionId: ' + questionId);
            System.debug('Answer: ' + answer);

            // Agregar el elemento actual a la lista resultante
            result.add(new QuestionWrapper(questionId, answer));

            // Llamar a una función recursiva para manejar los elementos hijos
            List<QuestionWrapper> childrenList = processChildren(item.children);

            // Agregar los elementos hijos a la lista resultante
            result.addAll(childrenList);
        }

        return result;
    }

    private static List<QuestionWrapper> processChildren(List<QuestionItem> children) {
        List<QuestionWrapper> result = new List<QuestionWrapper>();

        if (children != null && !children.isEmpty()) {
            // Recorrer los elementos hijos de manera recursiva
            for (QuestionItem child : children) {
                // Obtener QuestionId y Answer
                String questionId = child.questionId;
                String answer = child.answer;

                // Imprimir valores o hacer lo que necesites con ellos
                System.debug('QuestionId: ' + questionId);
                System.debug('Answer: ' + answer);

                // Agregar el elemento actual a la lista resultante
                result.add(new QuestionWrapper(questionId, answer));

                // Llamar de nuevo a la función recursiva para manejar los elementos hijos de este elemento
                List<QuestionWrapper> childList = processChildren(child.children);

                // Agregar los elementos hijos a la lista resultante
                result.addAll(childList);
            }
        }

        return result;
    }
}

