import type { ThinEngine } from '@babylonjs/core/Engines/thinEngine';
import type { Effect } from '@babylonjs/core/Materials/effect';
import debounce from 'lodash/debounce';

import type {
  CameraKit,
  CameraKitSession,
  CameraKitSessionEvents,
  CameraKitSource,
  ComputedFrameMetrics,
  Lens,
  LensPerformanceMeasurement,
} from '../../../../types/LensSDK';

import { WindowObjectType } from '../../../../types/WindowObject';

import { getDeviceLevel } from '../../../../helper/deviceLevel';

import { ILensSDK, ILensConfig, ILensSetupArgs, ILensTelemetryCallbacks } from './ILens';
import { IBaseLogger } from './IShared';
import { EmptyLogger } from './EmptyLogger';
import { LensResizeController } from './LensResizeController';

import type { Resolution } from '../../../../types/Resolution';
import type { VideoOrientation } from '../../../../types/CameraProps';

type ListenerData = {
  target: Node | WindowObjectType;
  event: string;
  callback: ((ev: KeyboardEvent) => void) | ((ev: Event) => void);
};

export class LensStep {
  private engine!: ThinEngine;

  private outputCanvas?: HTMLCanvasElement;
  private renderCanvas?: HTMLCanvasElement;

  private portraitCanvas?: HTMLCanvasElement;
  private portraitVideo?: HTMLVideoElement;
  private portraitCanvasStream?: MediaStream;

  private mutationObs?: MutationObserver;

  private inputStream?: MediaStream;
  private inputResolution: Resolution = {
    width: 0,
    height: 0,
  };

  private renderResolution: Resolution = {
    width: 0,
    height: 0,
  };

  private lensSDK!: ILensSDK;
  private apiToken!: string;
  private groupID!: string;
  private lowPerfGroupID?: string;
  private usedGroupID!: string;

  private effect?: Effect;
  private uniformName = 'uSnapLensData';

  private lenses?: Lens[];
  private activeLens?: Lens;

  private cameraKit?: CameraKit;
  private session?: CameraKitSession;
  private measurement?: LensPerformanceMeasurement;
  private lastMeasurement?: ComputedFrameMetrics;

  private lensSource?: CameraKitSource;

  private deviceLevel?: 'high' | 'main' | 'baseline';
  private videoOrientation: VideoOrientation = 'landscape';
  private mirrorVideo = false;

  private telemetryCallbacks?: ILensTelemetryCallbacks;

  private inputIgnoreCheck?: () => boolean;
  private onLensTapChange?: () => void;

  private currentRenderCanvasSize = {
    scale: 1,
    width: 1,
    height: 1,
  };

  private lastSizeCheck = -Infinity;
  private sizeCheckInterval = 1000;

  private lastAvgFPSTelemetryCall = -Infinity;
  private fpsTelemetryInterval = 10000;

  private lastLensApply = 0;
  private isApplyingLens = false;

  private logger: IBaseLogger = EmptyLogger;
  private host: WindowObjectType = window;

  private listeners: ListenerData[] = [];

  private resizeController?: LensResizeController;

  private debug = false;
  private isResizeCheckEnabled = false;

  private enabled = false;
  public enable() {
    this.enabled = true;
  }
  public disable() {
    this.enabled = false;
  }
  public get isEnabled(): boolean {
    return this.enabled;
  }

  private ready = false;
  public get isReady(): boolean {
    return this.ready;
  }

  private shouldResizeCheck = true;
  public toggleResizeCheck(shouldCheck = !this.shouldResizeCheck) {
    this.shouldResizeCheck = shouldCheck;
  }

  /**
   * Initial setup and updating internal settings/vars
   * @param {ThinEngine} engine
   * @param {ILensConfig} lens
   * @param {Effect} effect
   * @param {ILensTelemetryCallbacks} telemetryCallbacks
   * @param {ILensSetupArgs} setupArgs
   * @param {boolean} debug
   */
  public async setup(
    engine: ThinEngine,
    lens: ILensConfig,
    effect: Effect,
    telemetryCallbacks?: ILensTelemetryCallbacks,
    setupArgs?: ILensSetupArgs,
    debug = false,
  ) {
    this.engine = engine;
    this.effect = effect;
    this.debug = debug;

    this.lensSDK = lens.lensSDK;
    this.apiToken = lens.apiKey;
    this.groupID = lens.groupID;
    if (lens.lowPerfGroupID) this.lowPerfGroupID = lens.lowPerfGroupID;
    if (telemetryCallbacks) this.telemetryCallbacks = telemetryCallbacks;

    if (this.debug) this.logger = setupArgs?.logger || console;

    if (setupArgs?.renderCanvas) this.setRenderCanvas(setupArgs.renderCanvas);
    if (setupArgs?.inputIgnoreCheck) this.inputIgnoreCheck = setupArgs.inputIgnoreCheck;
    if (setupArgs?.onLensTapChange) this.onLensTapChange = setupArgs.onLensTapChange;
    if (setupArgs?.host) this.host = setupArgs.host;
    if (typeof setupArgs?.isResizeCheckEnabled !== 'undefined')
      this.isResizeCheckEnabled = setupArgs.isResizeCheckEnabled;

    this.resizeController = new LensResizeController({
      debug: this.debug,
      maxResolutionSteps: 2,
      // { width: 1280, height: 720 }
      maxResolution: LensResizeController.ResolutionList[3],
      // { width: 640, height: 360 }
      minResolution: LensResizeController.ResolutionList[LensResizeController.ResolutionList.length - 1],
    });

    this.mutationObs = new MutationObserver(this.onResize);

    this.setupOutputCanvasIfNeeded();
    this.setupPortraitCanvasIfNeeded();

    this.deviceLevel = getDeviceLevel();

    this.determineUsedLensGroup();

    await this.setupCameraKit();
  }

  /**
   * Update essential rendering values when reusing LensStep
   * @param { ThinEngine } engine
   * @param { Effect } effect
   */
  public updateSetup(engine: ThinEngine, effect: Effect) {
    this.engine = engine;
    this.effect = effect;
  }

  /**
   * Makes the decision what lens group should be used depending on the deviceLevel
   * @returns {string|undefined}
   */
  private determineUsedLensGroup(): string {
    const { deviceLevel, groupID, lowPerfGroupID, logger } = this;

    if (!lowPerfGroupID && groupID) this.usedGroupID = groupID;
    if (!groupID && lowPerfGroupID) this.usedGroupID = lowPerfGroupID;

    if (deviceLevel && lowPerfGroupID) {
      this.usedGroupID = !deviceLevel || deviceLevel === 'baseline' ? lowPerfGroupID : groupID;
    } else {
      this.usedGroupID = groupID;
    }

    logger.log('LensStep → determineUsedLensGroup', this.usedGroupID, { deviceLevel, groupID, lowPerfGroupID });

    return this.usedGroupID || groupID;
  }

  /**
   * Sets up the LensSDK base camera kit
   * @returns {Promise<void>}
   */
  private async setupCameraKit(): Promise<void> {
    const { apiToken, lensSDK, logger, telemetryCallbacks } = this;

    logger.log('LensStep → setupLensSDK', { lensSDK, apiToken });

    if (!apiToken || !lensSDK) return;

    const setupStartTime = performance.now();

    const lensPerformance = await lensSDK.estimateLensPerformance().catch(() => undefined);
    logger.log('LensStep → estimateLensPerformance', lensPerformance);

    try {
      this.cameraKit = await lensSDK.bootstrapCameraKit({
        apiToken,
        lensPerformance,
        logger: this.debug ? 'console' : 'noop',
      });
    } catch (err) {
      telemetryCallbacks?.onCameraKitSetupError?.({
        time: Math.ceil(performance.now() - setupStartTime),
        error: err,
      });
      throw new Error('LensStep → bootstrapCameraKit failed');
    }

    this.copyRenderCanvasSize();

    telemetryCallbacks?.onCameraKitSetupDone?.({
      time: Math.ceil(performance.now() - setupStartTime),
      estLensPerfCluster: lensPerformance?.cluster,
    });

    logger.log('LensStep → setupLensSDK', this.cameraKit);
  }

  /**
   * Creates a LensSDK session from camera kit
   * @returns {Promise<void>}
   */
  private async setupSession(): Promise<void> {
    const { cameraKit, logger, telemetryCallbacks } = this;

    logger.log('LensStep → setupSession - start', { cameraKit, outputCanvas: this.outputCanvas });

    this.setupOutputCanvasIfNeeded();
    this.setupPortraitCanvasIfNeeded();

    if (!cameraKit) return;

    const setupStartTime = performance.now();

    this.session = await cameraKit.createSession({
      liveRenderTarget: this.outputCanvas,
      renderWhileTabHidden: true,
    });

    this.session.events.addEventListener('error', (event: CameraKitSessionEvents) => {
      const { error } = event.detail;
      logger.error('LensStep → session error', { event, error });
      telemetryCallbacks?.onSessionError?.({
        error: error.name,
        message: error.message,
        cause: error.cause,
        lensID: this.activeLens?.id || '',
      });
    });

    this.measurement = this.session.metrics.beginMeasurement();

    this.copyRenderCanvasSize();

    telemetryCallbacks?.onSessionSetupDone?.({ time: Math.ceil(performance.now() - setupStartTime) });
    logger.log('LensStep → setupSession - done', { session: this.session });
  }
  /**
   * Checks if there is currently a session available and if not it sets one up
   * @returns {Promise<void>}
   */
  private async setupSessionIfNeeded(): Promise<void> {
    const { session, cameraKit } = this;

    if (session || !cameraKit) return;

    await this.setupSession();
  }

  /**
   * Sets stream as input stream for session and also sets flag if needs to be mirrored
   * @param {MediaStream} newInputStream
   * @param {boolean} shouldMirrorX
   * @returns {Promise<void>}
   */
  public async setInputStream(newInputStream: MediaStream, shouldMirrorX = true): Promise<void> {
    this.logger.log('LensStep → setInputStream', { inputStream: this.inputStream, newInputStream });

    await this.setupSessionIfNeeded();

    const { inputStream, session } = this;

    if (!session || inputStream === newInputStream) return;

    this.inputStream = newInputStream;

    const { width, height } = newInputStream.getVideoTracks()[0].getSettings();
    Object.assign(this.inputResolution, { width: width || 0, height: height || 0 } as Resolution);
    Object.assign(this.renderResolution, this.inputResolution);

    this.resizeController?.setInputResolution({ width: width || 0, height: height || 0 });

    this.lensSource = await session.setSource(newInputStream, {});

    await this.setMirrorVideo(shouldMirrorX);
  }

  /**
   * Sets the flag if the stream needs to get mirrored in camera kit
   * @param {boolean} shouldMirrorX
   * @returns { Promise<void>}
   */
  public async setMirrorVideo(shouldMirrorX = true): Promise<void> {
    this.logger.log('LensStep → setMirrorVideo', { lensSource: this.lensSource, shouldMirrorX });

    if (!this.lensSDK || !this.lensSource) return;

    const { lensSDK, lensSource } = this;
    this.mirrorVideo = shouldMirrorX;
    await lensSource.setTransform(shouldMirrorX ? lensSDK.Transform2D.MirrorX : lensSDK.Transform2D.Identity);
  }

  /**
   * Loads the given lens group depending on the device
   * @returns {Promise<Lens[]>}
   */
  public async loadLenses(): Promise<Lens[]> {
    const { cameraKit, usedGroupID, deviceLevel, logger, telemetryCallbacks } = this;

    logger.log('LensStep → loadLenses', { cameraKit, usedGroupID, deviceLevel });

    if (!cameraKit || !usedGroupID) return Promise.resolve([]);

    const loadingStartTime = performance.now();

    const { lenses } = await cameraKit.lensRepository.loadLensGroups([usedGroupID]);
    this.lenses = lenses;

    telemetryCallbacks?.onLoadLensesDone?.({
      time: Math.ceil(performance.now() - loadingStartTime),
      isLowPerfGroup: deviceLevel === 'baseline',
      lensCount: this.lenses?.length || 0,
    });

    return lenses;
  }

  /**
   * Sets the canvas camera kit should render to.
   * Also places the canvas directly behind the main one canvas and resizes it to match the main one
   * @param {HTMLCanvasElement} canvas
   */
  public setRenderCanvas(canvas: HTMLCanvasElement): void {
    const { mutationObs, renderCanvas, logger } = this;

    logger.log('LensStep → setRenderCanvas', { canvas, currentCanvas: renderCanvas });

    if (renderCanvas === canvas) return;

    this.renderCanvas = canvas;

    // Move outputCanvas to same parent
    if (this.outputCanvas && this.outputCanvas.parentElement !== this.renderCanvas?.parentElement) {
      this.renderCanvas?.parentElement?.insertBefore(this.outputCanvas, this.renderCanvas);
    }

    mutationObs?.disconnect();

    mutationObs?.observe(this.renderCanvas, {
      attributes: true,
      subtree: true,
      attributeFilter: ['style', 'width', 'height'],
    });

    this.setupEventProxy();
    this.copyRenderCanvasSize();
  }

  /**
   * Sets the canvas size to reach a performance improvement
   * @param {Resolution} resolution
   * @param {boolean} isOptimizedResize
   * @returns {Promise<void>}
   */
  public async setRenderSize(resolution: Resolution, isOptimizedResize = false) {
    if (!this.lensSource) return;

    await this.lensSource.setRenderSize(resolution.width, resolution.height);
    this.resizeController?.setRenderResolution(resolution, isOptimizedResize);
    Object.assign(this.renderResolution, resolution);
  }

  /**
   * Activate given lens to get rendered by camera kit
   * @param {Lens} lens
   * @param {boolean} playIfNotPlaying
   * @returns {Promise<boolean>}
   */
  public async setLens(lens: Lens, playIfNotPlaying = true): Promise<boolean> {
    await this.setupSessionIfNeeded();

    const {
      session,
      lenses,
      cameraKit,
      activeLens,
      isApplyingLens,
      usedGroupID,
      telemetryCallbacks,
      logger,
      videoOrientation,
    } = this;

    if (!session || !usedGroupID) return false;

    logger.log('LensStep → setLens', {
      lens,
      activeLens: activeLens?.id,
      loadedLenses: lenses,
      isApplyingLens,
      videoOrientation,
    });

    if (activeLens?.id === lens.id || isApplyingLens) return false;

    this.isApplyingLens = true;

    const neededLoading = !lenses;
    if (!lenses) {
      await cameraKit?.lensRepository.loadLens(lens.id, usedGroupID);
    }

    // lensWait event fires when requested lens is ready to render
    const lensWaitPromise = new Promise<void>((resolve, reject) => {
      if (!cameraKit?.metrics) {
        reject(new Error('CameraKit or Metrics are not defined.'));
        return;
      }
      cameraKit.metrics.addEventListener('lensWait', () => resolve(), { once: true });
    });

    this.lastLensApply = performance.now();
    this.activeLens = { ...lens };

    await Promise.allSettled([
      session.applyLens(lens),
      lensWaitPromise,
      // When we don't need to run play ↓
      !session.playing && playIfNotPlaying ? this.play() : undefined,
    ]);

    if (videoOrientation === 'portrait') {
      this.setupPortraitCanvasIfNeeded();
      this.setupPortraitVideoIfNeeded();
      this.copyRenderCanvasSize();
      this.playPortraitVideo();
    }

    if (this.outputCanvas) {
      Object.assign(this.outputCanvas.style, {
        pointerEvents: 'auto',
      });
    }
    if (this.portraitCanvas ) {
      Object.assign(this.portraitCanvas.style, {
        pointerEvents: 'auto',
      });
    }

    this.isApplyingLens = false;

    // Reset lastAvgFPSTelemetryCall to ignore the time while the lens gets setup
    this.lastAvgFPSTelemetryCall = performance.now();

    telemetryCallbacks?.onLensActivation?.({
      time: Math.ceil(performance.now() - this.lastLensApply),
      lensID: lens.id,
      neededLoading,
    });

    return true;
  }

  /**
   * Activates lens using the index of it, in the loaded lens list
   * @param {number} index
   * @returns {Promise<void>}
   */
  public async setLensByIndex(index: number): Promise<void> {
    const { lenses } = this;
    if (lenses && lenses.length > 0 && typeof lenses[index] !== 'undefined') {
      await this.setLens(lenses[index]);
    }
  }

  /**
   * Disables and removes the current lens
   * @returns {Promise<void>}
   */
  public async removeLens(): Promise<void> {
    await this.setupSessionIfNeeded();
    const { session, lastLensApply, activeLens, logger, isApplyingLens } = this;

    logger.log('LensStep → removeLens', { session, activeLens, isApplyingLens });

    if (!session || !activeLens) return;
    const lensID = activeLens?.id;

    await session.pause();
    await session.removeLens();
    delete this.activeLens;
    this.setUniforms();
    this.telemetryCallbacks?.onClearLens?.({ time: Math.ceil(performance.now() - lastLensApply), lensID });
    if (this.outputCanvas) {
      Object.assign(this.outputCanvas.style, {
        pointerEvents: 'none',
      });
    }
    if (this.outputCanvas) {
      Object.assign(this.portraitCanvas.style, {
        pointerEvents: 'none',
      });
    }
  }

  /**
   * Starts to render the current selected lens
   * @returns {Promise<void>}
   */
  public async play(): Promise<void> {
    const { session, logger } = this;

    if (!session) return;

    await session.play();
    logger.log('LensStep → play', session.playing);
  }

  /**
   * Pauses to render the current selected lens
   * @returns {Promise<void>}
   */
  public async pause(): Promise<void> {
    const { session, logger } = this;

    if (!session) return;

    await session.pause();
    logger.log('LensStep → pause', session.playing);
  }

  /**
   * Updates the uniforms of the given effect/shader
   */
  public setUniforms(): void {
    const { effect, uniformName, isEnabled, videoOrientation } = this;
    if (!effect) return;
    const isEnabledValue = isEnabled ? 1 : 0;
    const videoOrientationValue = videoOrientation === 'landscape' ? 0 : 1;
    effect.setFloat4(uniformName, isEnabledValue, videoOrientationValue, 0, 0);
  }

  /**
   * Update function ideally called on RAF
   */
  public update(): void {
    if (!this.session || !this.enabled) return;
    this.checkForResize();
    this.setUniforms();
    this.renderPortraitCanvasIfNeeded();
    this.checkForFPSTelemetryCall().catch((error: Error) =>
      this.logger.error('LensStep → update - checkForFPSTelemetryCall failed', error),
    );
  }

  /**
   * Sets up an event proxy that pipes all mouse and keyboard events from our rendering canvas
   * to the the lens camera kit output canvas
   */
  private setupEventProxy(): void {
    const { renderCanvas, logger, listeners, host } = this;

    logger.log('LensStep → setupEventProxy', { renderCanvas, listeners });

    this.setupOutputCanvasIfNeeded();
    this.setupPortraitCanvasIfNeeded();

    if (!renderCanvas) return;

    const eventTypes = ['mousedown', 'mouseup'];

    eventTypes.forEach(type => {
      const cb = (ev: Event) => {
        if (!this.inputIgnoreCheck?.()) {
          const proxyEvent = new MouseEvent(type, ev);
          this.outputCanvas?.dispatchEvent(proxyEvent);
          this.onLensTapChange?.();
        }
      };
      listeners.push({
        target: renderCanvas,
        event: type,
        callback: cb,
      });
      renderCanvas?.addEventListener(type, cb);
    });

    const keyboardEventTypes = { keydown: 'mousedown', keyup: 'mouseup' } as const;
    type KeyboardEventTypes = typeof keyboardEventTypes;

    Object.keys(keyboardEventTypes).forEach(type => {
      const cb = (ev: KeyboardEvent) => {
        const hasOrInsideSelector = (element: Element | null, selector: string): boolean => {
          let currElement = element;
          while (currElement) {
            if (currElement.matches?.(selector)) return true;
            currElement = currElement.parentElement;
          }
          return false;
        };

        if (
          ev.target instanceof HTMLInputElement ||
          ev.target instanceof HTMLTextAreaElement ||
          ev.code !== 'KeyM' ||
          (ev.target instanceof Element && hasOrInsideSelector(ev.target, '[role=textbox]')) ||
          this.inputIgnoreCheck?.()
        )
          return;

        if (!this.inputIgnoreCheck?.() && ev.code === 'KeyM') {
          const proxyEvent = new MouseEvent(keyboardEventTypes[type as keyof KeyboardEventTypes] as string, {
            altKey: false,
            bubbles: true,
            button: 0,
            buttons: 1,
            cancelable: true,
            clientX: (this.outputCanvas?.offsetWidth || 480) / 2 + (this.outputCanvas?.offsetLeft || 0),
            clientY: (this.outputCanvas?.height || 480) / 2,
            composed: true,
            ctrlKey: false,
            which: 1,
          });

          this.outputCanvas?.dispatchEvent(proxyEvent);
          this.onLensTapChange?.();
        }
      };

      listeners.push({
        target: host,
        event: type,
        callback: cb,
      });

      host?.addEventListener(type as keyof KeyboardEventTypes, cb);
    });
  }

  private copyRenderCanvasSize(): void {
    const { renderCanvas, logger, outputCanvas, currentRenderCanvasSize, videoOrientation, portraitCanvas } = this;
    logger.log('LensStep → copyRenderCanvasSize', { renderCanvas, outputCanvas });

    if (!renderCanvas || !outputCanvas) return;

    const boundingClientRect = renderCanvas.getBoundingClientRect();
    const scale = boundingClientRect.width / renderCanvas.offsetWidth;

    if (scale !== currentRenderCanvasSize.scale) {
      Object.assign(outputCanvas.style, {
        opacity: 0,
        position: 'absolute',
        transform: `scale(${scale})`,
      });

      this.currentRenderCanvasSize.scale = scale;
    }

    if (outputCanvas.offsetWidth !== renderCanvas.width || outputCanvas.offsetHeight !== renderCanvas.height) {
      outputCanvas.width = renderCanvas.width;
      outputCanvas.height = renderCanvas.height;

      Object.assign(outputCanvas.style, {
        width: `${renderCanvas.width}px`,
        height: `${renderCanvas.height}px`,
      });
    }

    if (portraitCanvas) {
      portraitCanvas.width = renderCanvas.width;
      portraitCanvas.height = renderCanvas.height;

      this.logger.log(
        'LensStep → copyRenderCanvasSize - portraitCanvas size',
        { videoOrientation },
        renderCanvas.width,
        renderCanvas.height,
        portraitCanvas.width,
        portraitCanvas.height,
      );

      Object.assign(portraitCanvas.style, {
        width: `${renderCanvas.width}px`,
        height: `${renderCanvas.height}px`,
        transform: `scale(${scale})`,
      });
    }
  }

  /**
   * Debounced! Updates and overwrites the camera kit canvas styling
   */
  private copyRenderCanvasSizeDebounced = debounce(() => this.copyRenderCanvasSize(), 1000);

  /**
   * Compares rendering and output canvas sizes to determine if resize is required
   */
  private checkForResize(): void {
    const { renderCanvas, currentRenderCanvasSize } = this;

    if (
      !renderCanvas ||
      performance.now() - this.lastSizeCheck < this.sizeCheckInterval ||
      // only check if activeLens has tap2Change
      this.activeLens?.vendorData?.tap_to_change !== '1'
    )
      return;

    const boundingClientRect = renderCanvas.getBoundingClientRect();
    const scale = boundingClientRect.width / renderCanvas.offsetWidth;

    if (scale !== currentRenderCanvasSize.scale) {
      this.copyRenderCanvasSize();
    }

    this.lastSizeCheck = performance.now();
  }

  /**
   * Creates a new canvas that can get used as LensStep output canvas
   */
  private setupOutputCanvas(): void {
    const { host } = this;

    this.logger.log('LensStep → setupOutputCanvas', { outputCanvas: this.outputCanvas });

    if (!this.outputCanvas) {
      this.outputCanvas = host.document.createElement('canvas');
    }

    // remove previous lensStep canvas ids and set current outputCanvas id
    if (!host.document.getElementById('fg-lensStep-canvas')?.isSameNode(this.outputCanvas)) {
      host.document.getElementById('fg-lensStep-canvas')?.remove();
      this.outputCanvas.setAttribute('id', 'fg-lensStep-canvas');
    }

    if (this.outputCanvas?.parentElement !== this.renderCanvas?.parentElement) {
      this.renderCanvas?.parentElement?.insertBefore(this.outputCanvas, this.renderCanvas);
    }

    Object.assign(this.outputCanvas.style, {
      opacity: 0,
      position: 'absolute',
      pointerEvents: 'none',
    });
  }

  /**
   * Creates a new outputCanvas if none exists
   */
  private setupOutputCanvasIfNeeded(): void {
    this.logger.log('LensStep → setupOutputCanvasIfNeeded', { outputCanvas: this.outputCanvas });
    if (!this.outputCanvas) this.setupOutputCanvas();
  }

  private setupPortraitCanvas(): void {
    const { host } = this;

    this.logger.log('LensStep → setupPortraitCanvas', { portraitCanvas: this.portraitCanvas });

    if (!this.portraitCanvas) {
      this.portraitCanvas = host.document.createElement('canvas');
    }

    // remove previous lensStep canvas ids and set current outputCanvas id
    if (!host.document.getElementById('fg-lensStep-portrait-canvas')?.isSameNode(this.portraitCanvas)) {
      host.document.getElementById('fg-lensStep-portrait-canvas')?.remove();
      this.portraitCanvas.setAttribute('id', 'fg-lensStep-portrait-canvas');
    }

    if (this.portraitCanvas?.parentElement !== this.renderCanvas?.parentElement) {
      this.renderCanvas?.parentElement?.insertBefore(this.portraitCanvas, this.renderCanvas);
    }

    Object.assign(this.portraitCanvas.style, {
      opacity: 0,
      position: 'absolute',
      pointerEvents: 'none',
    });

    this.copyRenderCanvasSize();
  }

  private setupPortraitCanvasIfNeeded(): void {
    this.logger.log('LensStep → setupPortraitCanvasIfNeeded', { portraitCanvas: this.portraitCanvas });
    if (!this.portraitCanvas) this.setupPortraitCanvas();
  }

  private setupPortraitVideo(): void {
    const { host } = this;

    this.logger.log('LensStep → setupPortraitVideo', { portraitVideo: this.portraitVideo });

    if (!this.portraitVideo) {
      this.portraitVideo = host.document.createElement('video');
      this.portraitVideo.muted = true;
      this.portraitVideo.hidden = true;
    }
  }

  private setupPortraitVideoIfNeeded(): void {
    this.logger.log('LensStep → setupPortraitVideoIfNeeded', { portraitVideo: this.portraitVideo });
    if (!this.portraitVideo) this.setupPortraitVideo();
  }

  private renderPortraitCanvasIfNeeded(): void {
    const { portraitCanvas, portraitVideo, videoOrientation } = this;
    if (!portraitCanvas || !portraitVideo || videoOrientation !== 'portrait') return;

    const { videoWidth, videoHeight } = portraitVideo;

    const outputWidth = portraitCanvas.width;
    const outputHeight = portraitCanvas.height;
    const cropX = videoWidth / 2 - outputWidth / 2;
    const cropY = 0;
    const ctx = portraitCanvas.getContext('2d');
    if (!ctx) return;
    ctx.setTransform(1, 0, 0, 1, 0, 0);
    ctx.clearRect(0, 0, portraitCanvas.width, portraitCanvas.height);
    if (this.mirrorVideo) {
      ctx.translate(portraitCanvas.width, 0);
      ctx.scale(-1, 1);
    }
    ctx?.drawImage(portraitVideo, cropX, cropY, outputWidth, videoHeight, 0, 0, outputWidth, outputHeight);
  }

  private playPortraitVideo(): void {
    const { portraitVideo, inputStream } = this;
    this.logger.log('LensStep → playPortraitVideo', { portraitVideo, inputStream });

    if (!portraitVideo || !inputStream) return;

    portraitVideo.srcObject = inputStream;
    portraitVideo.play().catch(error => {
      throw error;
    });
    portraitVideo.onloadedmetadata = this.setPortraitCanvasSource.bind(this);
  }

  private async setPortraitCanvasSource(): Promise<void> {
    const { portraitCanvas } = this;
    this.renderPortraitCanvasIfNeeded();
    this.portraitCanvasStream = this.portraitCanvas?.captureStream();
    // replace current source with portrait video stream
    if (!this.portraitCanvasStream) return;
    this.logger.log('LensStep → setPortraitCanvasSource', {
      width: portraitCanvas?.width || 0,
      height: portraitCanvas?.height || 0,
    });

    const renderSizePromise = this.setRenderSize(
      {
        width: portraitCanvas?.width || 0,
        height: portraitCanvas?.height || 0,
      },
      false,
    );
    this.lensSource = (await this.session?.setSource(this.portraitCanvasStream, {})) as CameraKitSource;
    await renderSizePromise;
  }

  private async stopPortraitVideo(): Promise<void> {
    const { portraitVideo, inputStream, session, portraitCanvas } = this;
    this.logger.log('LensStep → stopPortraitVideo', { portraitVideo });

    if (!portraitVideo || !inputStream || !session) return;

    this.lensSource = await session.setSource(inputStream, {});
    await this.setMirrorVideo(this.mirrorVideo);

    portraitVideo.pause();
    portraitVideo.srcObject = null;

    if (portraitCanvas) {
      const ctx = portraitCanvas.getContext('2d');
      ctx?.clearRect(0, 0, portraitCanvas.width, portraitCanvas.height);
    }
  }

  /**
   * Callback for onResize
   * Checks canvas sizes ans resizes if necessary
   */
  private onResize = () => {
    this.logger.log('LensStep → onResize');
    this.copyRenderCanvasSize();
  };

  /**
   * Gathers fps data and calls onAvgFps if existing
   * Also checks resizeController if should resize for perf
   * @returns {Promise<void>}
   */
  private async checkForFPSTelemetryCall(): Promise<void> {
    const {
      session,
      isApplyingLens,
      telemetryCallbacks,
      lastAvgFPSTelemetryCall,
      fpsTelemetryInterval,
      activeLens,
      videoOrientation,
    } = this;

    if (
      !session ||
      !session.playing ||
      isApplyingLens ||
      !telemetryCallbacks?.onAvgFps ||
      performance.now() - lastAvgFPSTelemetryCall < fpsTelemetryInterval
    )
      return;

    // ignore first call
    if (this.lastAvgFPSTelemetryCall > 0 && activeLens) {
      const measureResult = this.measurement?.measure();

      if (measureResult) {
        telemetryCallbacks?.onAvgFps?.({
          lensID: activeLens.id,
          avgFps: measureResult.avgFps,
          lensFrameProcessingTimeMsAvg: measureResult.lensFrameProcessingTimeMsAvg,
          videoOrientation: this.videoOrientation,
        });

        // TODO Only optimize resolution if video is in landscape mode for now
        if (videoOrientation === 'landscape') {
          this.resizeController?.update(measureResult.avgFps);
          await this.optimizeResolution();
        }

        this.lastMeasurement = measureResult;
      }
    }

    this.lastAvgFPSTelemetryCall = performance.now();
  }

  public updateVideoOrientation(orientation: VideoOrientation): void {
    this.logger.log('LensStep → updateVideoOrientation', { orientation });
    if (this.videoOrientation === orientation) return;
    this.videoOrientation = orientation;
    if (orientation === 'portrait') {
      this.setupPortraitCanvasIfNeeded();
      this.setupPortraitVideoIfNeeded();
      this.copyRenderCanvasSize();
      if (this.enabled) this.playPortraitVideo();
    } else {
      this.stopPortraitVideo().catch(() => {});
    }
  }

  /**
   * Gets current optimal resolution from resizeController
   * @returns {Promise<void>}
   */
  private async optimizeResolution(): Promise<void> {
    const { activeLens, shouldResizeCheck, isResizeCheckEnabled, lastMeasurement } = this;
    if (!(shouldResizeCheck && isResizeCheckEnabled) || !activeLens) return;

    const optimizedResolution = this.resizeController?.calculateOptimalResolution();
    const previousResolution = { ...this.renderResolution };

    if (
      optimizedResolution &&
      (optimizedResolution.width !== previousResolution.width ||
        optimizedResolution.height !== previousResolution.height)
    ) {
      await this.setRenderSize(
        {
          width: optimizedResolution.width,
          height: optimizedResolution.height,
        },
        true,
      );

      this.telemetryCallbacks?.onResize?.({
        lensID: activeLens?.id || '',
        avgFps: lastMeasurement?.avgFps || 0,
        previousResolution,
        currentResolution: optimizedResolution,
      });

      this.logger.log('LensStep → optimizeResolution', {
        shouldResizeCheck: this.shouldResizeCheck,
        isResizeCheckEnabled: this.isResizeCheckEnabled,
        optimizedResolution,
      });
    }
  }

  /**
   * Disposes event listeners from the event proxy
   */
  public disposeListeners(): void {
    const { logger, listeners } = this;

    logger.log('LensStep → disposeListeners', listeners);

    listeners.forEach((data: ListenerData) => {
      data.target.removeEventListener(data.event, data.callback as EventListenerOrEventListenerObject);
    });
    this.listeners = [];
  }

  /**
   * Disposes the lens step and its vars
   * @returns {Promise<void>}
   */
  public async dispose(): Promise<void> {
    this.logger.log('LensStep → dispose');

    this.engine?.dispose();
    this.effect?.dispose();
    this.mutationObs?.disconnect();
    this.outputCanvas?.remove();
    delete this.cameraKit;
    this.disposeListeners();
    await this.session?.destroy();
  }
}
export default LensStep;

#!/usr/bin/env python3

from pathlib import Path
from urllib import parse, request
import gzip
import json
import sys

BASE_URL = "https://cloud-api.yandex.net/v1/disk/public/resources/download?public_key="


def fetch_json(url: str) -> dict[str, str]:
    with request.urlopen(url) as res:
        response_info = response.info()

        content_encoding = response_info["Content-Encoding"]
        if content_encoding == "gzip" or content_encoding == "deflate":
            buffer = gzip.GzipFile(fileobj=BytesIO(response.read()), mode="rb")
        else:
            buffer = response

        content_charset = response_info.get_content_charset("utf-8")
        return json.load(buffer, encoding=content_charset)


def dl_stuff(u: str):
    data = fetch_json(BASE_URL + parse.quote_plus(u))
    dl_url = data["href"]
    file_name = parse.parse_qs(parse.urlparse(dl_url).query).get("filename")[0]
    request.urlretrieve(dl_url, Path.cwd().joinpath(file_name))


if __name__ == "__main__":
    for u in sys.argv[1:]:
        dl_stuff(u)

